import { ScrapeProvider } from "./ScrapeContext";
import { Text } from "react-native";
import React, { useEffect, useState } from "react";

export default function Page({ children }) {
  return (
    <ScrapeProvider value={{ hey: "ho", lets: "go" }}>
      <Text>{children}</Text>
    </ScrapeProvider>
  );
}
